import React from 'react';
import { styled } from '@mui/material/styles';
import {Box,Grid,Divider} from '@mui/material';

const Dashboard = () => {
  const Container = styled(Grid)({
    padding: `30px`
  });
  const MyDivider = styled(Divider)({
    padding: `10px`
  });

  return (
    <Box>
      <Gird container>
        <Grid xs={6}>
          today
          2023.02.09
        </Grid>
        <MyDivider/>
        <Grid xs={3}>
          calandar
        </Grid>
      </Gird>
    </Box>
  )
}

export default Dashboard
